import React, { Component , PureComponent } from 'react';

class Child extends PureComponent {

    constructor(props){
        super(props);
        this.state={}
    }

    render() {

        return (
            <div className="">
                <h2>Child</h2>
            </div>
        );
    }}



export default Child;
